import React, { useState, useEffect } from "react";
import "./superHome.css";

export default function SuperUserData() {
  const [loading, setLoading] = useState(true);
  const [data, setData] = useState([]);
  const [sortColumn, setSortColumn] = useState(null);
  const [isSortedDesc, setIsSortedDesc] = useState(false);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = () => {
    fetch("http://localhost:5000/getAllData")
      .then((response) => response.json())
      .then((data) => {
        setData(data);
        setLoading(false);
      });
  };

  const createCompany = () => {
    // Implement the logic for creating a new company here
    // You can show a form or send a request to the server
  };

  const createSuperUser = () => {
    // Implement the logic for creating a new SuperUser here
    // You can show a form or send a request to the server
  };

  const deleteUser = (id, name) => {
    const confirmDelete = window.confirm(
      `Are you sure you want to delete ${name}`
    );
    if (confirmDelete) {
      fetch(`http://localhost:5000/deleteUser/${id}`, {
        method: "DELETE",
      })
        .then((response) => {
          if (response.status === 200) {
            // User was deleted successfully, refresh the data
            fetchData();
          } else {
            console.error("Error deleting user:", response.statusText);
          }
        })
        .catch((error) => {
          console.error("Error deleting user:", error);
        });
    }
  };
  const deleteCompany = (id, name) => {
    const confirmDelete = window.confirm(
      `Are you sure you want to delete ${name}`
    );
    if (confirmDelete) {
      fetch(`http://localhost:5000/deleteCompany/${id}`, {
        method: "DELETE",
      })
        .then((response) => {
          if (response.status === 200) {
            // User was deleted successfully, refresh the data
            fetchData();
          } else {
            console.error("Error deleting user:", response.statusText);
          }
        })
        .catch((error) => {
          console.error("Error deleting user:", error);
        });
    }
  };
  const handleSort = (column) => {
    if (column === sortColumn) {
      setIsSortedDesc(!isSortedDesc);
    } else {
      setSortColumn(column);
      setIsSortedDesc(false);
    }
  };

let sortedUsers = [...data.data.users];
let sortedCompanies = [...data.data.companies];

if (sortColumn) {
  sortedUsers.sort((a, b) => {
    if (isSortedDesc) {
      return b[sortColumn].localeCompare(a[sortColumn]);
    } else {
      return a[sortColumn].localeCompare(b[sortColumn]);
    }
  });

  sortedCompanies.sort((a, b) => {
    if (isSortedDesc) {
      return b[sortColumn].localeCompare(a[sortColumn]);
    } else {
      return a[sortColumn].localeCompare(b[sortColumn]);
    }
  });
}


  return (
    <div>
      <div className="button-container">
        <button onClick={createCompany} className="btn btn-success">
          Create Company
        </button>
        <button onClick={createSuperUser} className="btn btn-primary">
          Create SuperUser
        </button>
      </div>
      {loading ? (
        <p>Loading...</p>
      ) : (
        <div>
          <table className="table table-striped table-bordered">
            <thead>
              <tr>
                <th onClick={() => handleSort("ID")}>
                  ID {sortColumn === "ID" && (isSortedDesc ? " ⬇ " : " ⬆ ")}
                </th>
                <th onClick={() => handleSort("Name")}>
                  Name {sortColumn === "Name" && (isSortedDesc ? " ⬇ " : " ⬆ ")}
                </th>
                <th onClick={() => handleSort("Email")}>
                  Email{" "}
                  {sortColumn === "Email" && (isSortedDesc ? " ⬇ " : " ⬆ ")}
                </th>
                <th onClick={() => handleSort("UserType")}>
                  User Type{" "}
                  {sortColumn === "UserType" && (isSortedDesc ? " ⬇ " : " ⬆ ")}
                </th>
                <th>Delete</th>
              </tr>
            </thead>

            <tbody>
              {sortedUsers.map((user) => (
                <tr key={user._id}>
                  <td>{user._id}</td>
                  <td>
                    {user.fname} {user.lname}
                  </td>
                  <td>{user.email}</td>
                  <td>{user.userType}</td>
                  <td
                    className="btn btn-danger"
                    onClick={() =>
                      deleteUser(user._id, `${user.fname} ${user.lname}`)
                    }
                  >
                    Delete
                  </td>
                </tr>
              ))}
              {sortedCompanies.map((company) => (
                <tr key={company._id}>
                  <td>{company._id}</td>
                  <td>
                    {company.fname} {company.lname}
                  </td>
                  <td>{company.email}</td>
                  <td>{company.userType}</td>
                  <td
                    className="btn btn-danger"
                    onClick={() =>
                      deleteCompany(company._id, `${company.email}`)
                    }
                  >
                    Delete
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}
